import { useCookies } from "react-cookie";
import { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import axios from 'axios';

function Profile(){
    const [cookies, setCookie] = useCookies();
    const navigate = useNavigate();
    const [blogs,setBlog] = useState([]);

    // useEffect(() => {
        let id = window.location.pathname.split('/');
        id = id[id.length-1];
        axios.post('http://localhost:4000/getBlogs', {
            id: id,
        }).then(response => {
            for(let i=0;i<response.data.length;++i) {
                blogs.push(response.data[i]);
            }
            console.log(blogs,"first");
        }).catch(err => {
            console.log(err);
        });
    // }, []);    

    useEffect(() => {
        if (cookies.username === undefined) {
            navigate('/');
        }
        axios.get('http://localhost:4000/authenticate', { headers: { "Authorization": `Bearer ${cookies.username}` } }).then(response => {
            // console.log(response);
        }).catch(err => {
            // console.log(err);
            navigate("/");
        })
    }, [cookies.username]);
    console.log(blogs,"Second");
    return (
        <div>
            {
                blogs.map((blog)=>{
                    console.log(blog);
                })
            }
        </div>
    );
}

export default Profile;
